import './footer.css';

export function Footer() {
    return (
        <div id="footer">
            <img src="/images/Logo.png" alt="" />
            <div>2024 Kirill Tarochkin</div>
            <div>
                <img src="/images/" alt="instagram" />
                <img src="/images/" alt="telegram" />
                <img src="/images/" alt="linkedin" />
                <a href='www.google.com'>Ccskrf</a>
            </div>
        </div>
    )
}
